        const [list, setList] = useState([]);

        setList((oldItems)=>{
            return [...oldItems, Note];
        });

    alert(Note);    
    }

    return(
        <div className="container-{breakpoint}">
            <HeaderComp />
            <br />
            <CreateNoteComp />
            <br />
            <FooterComp />
